import React from 'react';
import "./Chat.css"

function Chat() {
    return (
        <div className="chat">

            {/* chat hearder */}
            <div className="chat__header">
                <h4>To: <span className="chat__name">Channel name</span></h4>
                <strong>Details</strong>
            </div>
            {/* chat message */}

            {/* chat input */}
            <div className="chat__input">
                <form>
                    <input placeholder="iMessage" type="text" />
                        <button onClic>Send Message</button>
                </form>
            </div>
        </div>
    )
}

export default Chat
